import React, { useState } from "react";

const Health = () => {
  const [happyItems, setHappyItems] = useState([]);
  const [mehItems, setMehItems] = useState([]);
  const [sadItems, setSadItems] = useState([]);

  const addItem = type => {
    items.push(item);
    setItems(items);
    console.log(items);
  };

  return <button onClick={() => addItem("this")}>This</button>;
};

export default Health;
